import Header from './Header';
import Footer from './Footer';
import Note from './Note';

function Card(){
	return <div> 
		<h2> Beyounce </h2> 
		<img src=
"https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
alt="avtar_img" />
		<p> +123 456 789 </p>
		<p> b@Beyounce.com </p>
	</div>
}
function App(){
	return <div>
	<Header /> 
	<Note />
	<Card />
	<Footer />
	</div>
}

export default App;
